import React, { useState, useEffect } from "react";
import { withRouter } from "react-router-dom";

let ListManagementPage = props => {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    setLoading(false);
  }, []);

  let results = loading ? (
    <p>Loading...</p>
  ) : (
    <div>
      <h1 />
    </div>
  );
  return results;
};

export default withRouter(ListManagementPage);
